const boostAfter = rtk.length>0 && grabbedTotal>0 && (grabbedUntil/grabbedTotal) > (1.2*(stationIndex-1)/rtk.length);
const s2 = `S${stationIndex}-2`;
const s3 = `S${stationIndex}-3`;
const decision = !boostAfter &&
  (!(s2 in sensors) || 0 == sensors[s2]) &&
  (!(s3 in sensors) || 0 == sensors[s3]);
return verbose ? {decision: decision, /*sensors: sensors,*/ until: grabbedUntil, total: grabbedTotal, boost: boostAfter} : decision;

